        'content': 'The latest from the Richland Borough Council Meeting. Img 2474 With the opening of Rey Azteca in Palmyra, Lebanon County is starting to amass a nice collection of Mexican restaurants   and were not talking Taco Bell or Chipotle here. Anyone who still tells you there are no good local Mexican places in Lebanon probably doesnt know where to look, so just in case, heres a convenient guide for you. Previously: Learn more about Rey Azteca Img 2485 La Placita de Lebanon is a throwback. Its part Mexican restaurant, part bodega   a Hispanic mini-mart   but dont let that turn you off. Thats how you know its authentic. Located at 922 Cumberland St., in the heart of downtown, La Placita boasts great enchiladas, burritos and tacos, as you would expect, though there are items here you wont see a lot of other places, like all-day breakfast and traditional Mexican entrees that go beyond the typical handhelds. The prices are very reasonable and the staff is inviting, so theres no reason not to give it a shot. Img 2490 Known for oversized margaritas, guacamole made fresh at your table and authentic Mexican cuisine, Plaza Azteca opened its 41st location in Myerstown in March   and its a huge hit. This place doesnt feel like a chain at all in terms of the quality of the food, and the menu has all the staples of a Mexican restaurant and then some. Portions are large, too, so all but the biggest eaters might be taking some home, especially if you dig into the complimentary chips and salsa. More: Get the scoop on Plaza Azteca opening in Myerstown rotunda-brewing-company-beer-annville-expansion-4 Not strictly a Mexican restaurant by any means, as Batdorf Restaurant does great pub fare and craft beers from its on-site brewery, Rotunda Brewing Co., plus other types of cuisine. However, theres a whole section of the menu dedicated to tacos and burritos, a variety of salsas   some you wont find anywhere else   and piping hot fajitas with your choice of protein. The Batdorf is a great place to dine on any occasion, but if youre in Annville and craving Mexican cooking, its a no-brainer. More: Whats new at Rotunda Brewing? Img 2480 You would never know it by the name, but Franciscos Pizza has quite possibly the best authentic tacos anywhere in the Lebanon Valley. Choose from steak, chorizo, beef tongue, chicken, a combination, or my personal favorite, the pork adovada, all on soft corn tortillas with onion and cilantro   order three and a can of soda for $7.95. Franciscos also quesadillas, tortas (a type of sandwich) and a Mexican pizza. The rest of the menu is mostly Italian fare, as the name suggests, so you would never think this little hole in the wall at 375 N. 10th St. in Lebanon has great Mexican food. Its truly a diamond in the rough. Img 2487 More of a Tex-Mex menu than an authentic Mexican restaurant, Quesa Deeas at 708 Cumberland St. in downtown Lebanon is still worth highlighting here. Theres a nice selection of burritos and quesadillas on the menu, and there are always rotating specials. What makes Quesa Deeas different is the focus on burgers and sandwiches, many of which are made with ingredients popular in southwestern cooking, but you can grab a taco here too if thats what youre looking for.'
